import React from 'react';
import './Style1.css';

const products = [
  {
    title: 'Oils',
    desc: 'High-quality petroleum-based oil suitable for various industrial and commercial applications.',
    image: '/images/oil.jpg'
  },
  {
    title: 'Lubricants',
    desc: 'Engineered lubricants that reduce friction, wear and tear, and optimize machinery performance.',
    image: '/images/lubricant.jpg'
  },
  {
    title: 'Wheat',
    desc: 'Premium wheat sourced for baking and milling industries, offering top quality and consistency.',
    image: '/images/wheat.jpg'
  },
  {
    title: 'Vegetable Oil',
    desc: 'Refined vegetable oils ideal for cooking and food production, offering purity and nutrition.',
    image: '/images/veg_oil.jpg'
  },
  {
    title: 'Fuel',
    desc: 'Reliable fuels for transport and industrial needs, ensuring efficiency and energy output.',
    image: '/images/fuel.jpg'
  },
];

export default function Products() {
  return (
    
    <div className="container">
      <h2 style={{fontWeight:'700',fontSize:'48px'}}>Our Products</h2>
  <div className="products">
    <div className="box1">
      <div className="image-wrapper">
        <img src="/images/fuel.png" alt="Fuel" />
      </div>
    </div>
    <div className="box2">
      <div className="image-wrapper">
        <img src="/images/lubricant.png" alt="Lubricant" />
      </div>
    </div>
    <div className="box3">
      <div className="image-wrapper">
        <img src="/images/wheat.png" alt="Wheat" />
      </div>
    </div>
    <div className="box4">
      <div className="image-wrapper">
        <img src="/images/vegetable.png" alt="Vegetable" />
      </div>
    </div>
  </div>
</div>

  );
}
